import React, {useState} from 'react';
import { useNavigate } from 'react-router-dom';

export default function VolunteerLogin(){
    const demoEmail = 'abc@gmail.com'
    const demoPassword = 'abc'
    const [error, setError] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const handleVolRegister = (event) => {
        navigate('/volregister')
    }

    const handleAdminRegister = (event) => {
        navigate('/adminregister')
    }

    const handleAdminLogin = (event) => {
        navigate('/adminlogin')
    }

    const handleSubmit = (event) => {
        event.preventDefault();
        if(email === demoEmail && password === demoPassword){
            setError('');
            navigate('/volhome');
        }
        else{
            setError('Invalid email or password')
        }
    }
    return(
        <div style={{textAlign: 'center', display: 'flex', justifyContent: 'center', backgroundColor: '#CCCCFF', height: '100vh'}}>
            <div className='form-div' style={{ border: '1px solid black', padding: '20px', marginTop: '8%', height: '50%', width: '40%', backgroundColor: 'white', color: 'black'}}>

            <form onSubmit={handleSubmit}>
                <div><h1>Volunteer Log In Here</h1>
                <hr />
                </div>
                <label>
                <p>Email <input type="text" onChange={e => setEmail(e.target.value)} /></p>

                </label>
                <label>
                <p>Password <input type="password" onChange={e => setPassword(e.target.value)} /></p>

                </label>
                <div>
                <br />
                <div><button style ={{backgroundColor: '#CCCCFF', boxShadow: '0px 2px 2px lightgray', border: '1px solid black'}} type="submit">Submit</button></div>
                <br/>
                <div style={{display: 'flex', float: 'center'}}><div><button style ={{backgroundColor: '#CCCCFF', boxShadow: '0px 2px 2px lightgray', border: '1px solid black'}} onClick={handleVolRegister}>Volunteer Registration</button></div>  
                <br />
                <div><button style ={{backgroundColor: '#CCCCFF', boxShadow: '0px 2px 2px lightgray', border: '1px solid black'}} onClick={handleAdminLogin}>Admin Login</button></div>
                <br />
                <div><button style ={{backgroundColor: '#CCCCFF', boxShadow: '0px 2px 2px lightgray', border: '1px solid black'}} onClick={handleAdminRegister}>Admin Registration</button></div>
                </div>
                </div>
                {error && <div>{error}</div>}
            </form>
            </div>
        </div>
    );
}
